import React from 'react';
import {Link} from "react-router-dom";
import ExternalLink from './ExternalLink';
import Headshot from '../images/jonah-picture.JPG';

function About()
{
    return( 
        <div className="bg-black pt-20">
            <img src={Headshot} className="w-full"></img>
            <section className="py-8">
                <div class="max-w-4xl mx-auto px-4 md:px-0">
                <p className="font-display text-white font-semibold text-2xl md:text-4xl text-center">Thanks for reading!</p>
                <div className="mx-auto max-w-max pt-4">
                    <Link to="/TraceProject">
                        <button className="transition font-semibold text-center uppercase text-brandGreen bg-transparent font-display h-10 border-2 border-brandGreen hover:bg-brandGreen hover:text-black shadow-md hover:shadow-lg active:shadow-sm px-12">Next Project</button>
                    </Link>
                </div>
                </div>
            </section>
        </div>                 
    );
}

export default About;
